import React from 'react';
import css from './donut.module.css';
import PieChart from 'react-minimal-pie-chart';


const donut = () => {
    return (
        <div>
        <PieChart
            data={[
                
                { title: 'Three', value: 16.4, color: 'green' },
                { title: 'Two', value: 31.2, color: 'red' },
                { title: 'One', value: 52.4, color: 'blue' },
                
                
            ]}
            lineWidth={20}
            animate
        />
        </div>);
}

export default donut;
